PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT DISTINCT ?senator ?senatorLabel WHERE {
  ?senator wdt:P31 wd:Q5 ; p:P39 ?stmt .
  ?stmt ps:P39 wd:Q4416090 ; pq:P768 ?district .
  ?district wdt:P131 wd:Q1370 .
  OPTIONAL {
    ?stmt pq:P580 ?start .
  }
  OPTIONAL {
    ?stmt pq:P582 ?end .
  }
  FILTER ( NOT EXISTS {
    ?stmt pq:P582 ?endFilter .
    FILTER ( ?endFilter < "2013-01-01T00:00:00Z" ^^ xsd:dateTime )
  }
  ) FILTER ( NOT EXISTS {
    ?stmt pq:P580 ?startFilter .
    FILTER ( ?startFilter > "2013-12-31T23:59:59Z" ^^ xsd:dateTime )
  }
  ) OPTIONAL {
    ?senator rdfs:label ?senatorLabel .
    FILTER ( LANG( ?senatorLabel ) = "en" )
  }
}
ORDER BY ?senatorLabel

